import React from "react";
import board from "./../images/board.png"

class Info extends Comment
{
    clicked()
    {
        return(
            <div className="Clicked">
                It was clicked!!!
            </div>
        );
    }

    render()
    {
        return(
            <div className="Info">
                <img src={board} onClick={this.clicked} />
            </div>
        );
    }
}

export default Info;
